import React from "react";
import "./CardInfo.css";

export default function CardInfo({ header, text, link, extraClass }) {
  let divClass = `${extraClass} inline-block`;
  return (
    <div className={divClass}>
      <h2 className="extra-info-header">{header}</h2>
      <p className="extra-info-text">
        {text}
        {"\n"}
        {link}
      </p>
    </div>
  );
}
